  <style type="text/css">
* { padding: 0; margin: 0; }
body { background: #eef2f5; font-family: 'Myriad Set Pro', 'Arial', 'Helvetica', 'sans-serif'; }
body { -webkit-touch-callout: none; -webkit-user-select: none; -khtml-user-select: none; -moz-user-select: none; -ms-user-select: none; user-select: none; }
body { overflow: hidden; }
.main { position: absolute; margin: auto; top: 0; bottom: 0; right: 0; left: 0; width:100%; height: 200px; text-align: center; }
.main .img { width: 150px; height: 100px; margin: 0 auto; margin-bottom: 1px; }
.main .img svg{ width: 100%; height: 100%; }
.main .error-tip { font-size: 1rem; text-align: center; color: #01044b; padding: 5px 1px; }
.main .error-description { font-size: 0.8rem; text-align: center; color: #808080; padding: 5px 0px; }
.main .btn { display: inline-block; padding: 5px 30px; margin-top: 2px; background: #2fd792; border-radius: 20px; height: 30px; line-height: 30px; cursor:pointer; }
.main .btn button { color: #fff; text-decoration: none; font-size: 1rem; text-transform: uppercase; background: none; border: none; padding: 0; }
.main .btn button:focus { outline: none; }
.main .btn:hover { background: #26ca87; }

.blink_text { animation:1s blinker linear infinite; -webkit-animation:1s blinker linear infinite; -moz-animation:1s blinker linear infinite; color: red; } @-moz-keyframes blinker { 0% { opacity: 1.0; } 50% { opacity: 0.0; } 100% { opacity: 1.0; } } @-webkit-keyframes blinker { 0% { opacity: 1.0; } 50% { opacity: 0.0; } 100% { opacity: 1.0; } } @keyframes blinker { 0% { opacity: 1.0; } 50% { opacity: 0.0; } 100% { opacity: 1.0; } }
